import NavBars from './components/NavBars';


const Index = () => (
    
<div className="wrapper">

<NavBars />

<div>
<img src='<a href="http://es.tinypic.com?ref=10xrr6o" target="_blank"><img src="http://i64.tinypic.com/10xrr6o.png" border="0" alt="Image and video hosting by TinyPic"></a>'></img>
</div>


<style jsx>{`
        p{   
          font-family: 'Barlow', sans-serif;
          
        }
        div{
            text-align: center;
        }

       
      `}</style>
</div>

  );
  
  export default Index;
